    Turner99::Turner99(const ParameterVector params):
        NNDBConstants(params)
    {
        initMiscValues();

        initLoopValues();
        initTstkValues();

        initStackValues();
        initDangleValues();
        initTloopValues();
        initIloop11Values();
        initIloop21Values();
        initIloop22Values();
    }

    void Turner99::initMiscValues() {
        // Extrapolation for large loops based on polymer theory
        // internal, bulge or hairpin loops > 30: dS(T)=dS(30)+param*ln(n/30)
        prelog = params.dummy_scaling * mpq_class(1079, 1000);

        // Maximum correction for asymmetric internal loops per Ninio
        maxpen = params.dummy_scaling * mpq_class(3);

        // Ninio's f(m) array
        std::fill(poppen.begin(), poppen.end(), params.dummy_scaling * mpq_class(1, 2));

        // Multibranch loop
        multConst[0] = params.multiloop_penalty;
        multConst[1] = params.unpaired_penalty;
        multConst[2] = params.branch_penalty;

        // Non-GC terminal pair penalty (sometimes called "AU penalty")
        auend = params.dummy_scaling * mpq_class(1, 2);

        // Bonus for GGG hairpin
        gubonus = params.dummy_scaling * mpq_class(-11, 5);

        // C hairpin slope
        cslope = params.dummy_scaling * mpq_class(31, 100);

        // C hairpin intercept
        cint = params.dummy_scaling * mpq_class(8, 5);

        // C hairpin of 3
        c3 = params.dummy_scaling * mpq_class(7, 5);

        // GAIL rule (Grossly Asymmetric Interior Loop)
        gail = true;

        // Nobody seems to know quite what these are, but we'd better set them anyway
        eparam[1] = 0;
        eparam[2] = 0;
        eparam[3] = 0;
        eparam[4] = 0;
        eparam[7] = params.dummy_scaling * mpq_class(3, 10);
        eparam[8] = params.dummy_scaling * mpq_class(3, 10);
        eparam[9] = params.dummy_scaling * mpq_class(-5);

        // Scale infinity if needed
        if (abs(params.dummy_scaling > 1)) {
            INFINITY_ *= abs(params.dummy_scaling);
        }
    }

