        stack[BASE_A][BASE_U][BASE_U][BASE_G] = params.dummy_scaling * mpq_class(-7, 5);

        stack[BASE_C][BASE_G][BASE_A][BASE_U] = params.dummy_scaling * mpq_class(-21, 10);
