        stack[BASE_C][BASE_G][BASE_U][BASE_A] = params.dummy_scaling * mpq_class(-21, 10);
        stack[BASE_C][BASE_G][BASE_U][BASE_G] = params.dummy_scaling * mpq_class(-21, 10);

