        stack[BASE_G][BASE_C][BASE_U][BASE_G] = params.dummy_scaling * mpq_class(-5, 2);

        stack[BASE_G][BASE_U][BASE_A][BASE_U] = params.dummy_scaling * mpq_class(-13, 10);
